                    var error = 1;
                }
            }
            if ($('#m_display').val() == ""){
                var error_message = error_message.concat("原材料表示での表示名を入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if ($('#m_display').val().length > 20){
                 var error_message =  error_message.concat("原材料での表示名は20文字以内で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if ($('#m_madein').val() == ""){
                var error_message = error_message.concat("原産地を入力してください\n");    //エラーメッセージを出力
