            }
            if ($('#m_madein').val().length > 20){
                 var error_message =  error_message.concat("原産地は10文字以内で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_rot').val().match(/^[0-9]*$/)){
                var error_message =  error_message.concat("梱包量は半角数字で入力してください\n");    //エラーメッセージを出力
