            if (!$('#m_price').val().match(/^[0-9]*$/)){
                var error_message =  error_message.concat("価格は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_energy').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("熱量は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_protein').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("たんぱく質は半角数字で入力してください\n");    //エラーメッセージを出力
