                var error = 1;
            }
            if (!$('#m_carbon').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("炭水化物は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_salt').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("食塩相当量は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_salt').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("食塩相当量は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_destruction').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("廃棄率は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if (!$('#m_weight').val().match(/^[0-9.]*$/)){
                var error_message =  error_message.concat("重量変化率は半角数字で入力してください\n");    //エラーメッセージを出力
                var error = 1;
            }
            if(error==0){
                var id = $('input[name="edit_id"]').val();
                var times = $('#material_times').val()
                var array = [$('#m_name').val(),$('#m_name_kana').val(),$('#m_display').val(),$('#m_madein').val(),$('#m_rot').val(),$('#m_price').val(),$('#m_energy').val(),$('#m_protein').val(),$('#m_fat').val(),$('#m_carbon').val(),$('#m_salt').val(),$('#m_destruction').val(),$('#m_weight').val(),id];
                //条件に一致しない場合
                $.post("sample.php", {add_material:array},'json').done(
                    function(data, textStatus, xhr){
