    <div class="modal js-modal"><div class="modal__bg js-modal-close"></div><div class="modal__content"><div id="target_box"></div><div class="container"><h1></h1><p class="breadcrumbs"><a href="sample.php"></a>&gt;<span></span></p><h2></h2><div class="table"><div class="caption"></div><div class="table_line"><div class="menu">商品名<div class="needed">必須</div></div><div class="input"><div class="detail_box" id="name_detail">商品の名称です。入力者が後でわかりやすい名称を入力してください。</div><input type="text" class="wide" name="name" value=""><p class="alert">20文字以内</p></div></div><div class="table_line"><div class="menu">カテゴリ</div><div class="input"><div class="detail_box" id="category_detail">デモ画面ではカテゴリ機能を使用できません。</div><select name="category_select" class="wide" disabled><option value="0">未分類</option></select></div><div class="table_line"><div class="menu">品質表示の名称名<div class="needed">必須</div><a href="javascript:void(0)" class="js-modal-open" id="groups"><i class="far fa-question-circle"></i></a></div><div class="input"><div class="detail_box" id="groups_detail">食品表示に記載される名称です。ここには「商品名」ではなく、「一般的な名称」として記載する必要があります。例えば、「〇〇ケーキ」などは「洋菓子」と表示します。</div><input type="text" class="wide" name="groups" value=""><p class="alert">10文字以内</p></div></div><div class="table_line"><div class="menu">原材料<div class="needed">必須</div><a href="javascript:void(0)" class="js-modal-open" id="materials"><i class="far fa-question-circle"></i></a></div><div class="input"><div class="detail_box" id="materials_detail">食品表示に記載される原材料を選択します。レシピに従って、原材料名を選択し分量を入力してください。順序は自動的に調整されますので、分量順に入力する必要はありません。使用しない欄は、空白のままにしてください。登録済みの原材料の編集は<a href="#modal_b" class="open_modal noblock">こちら</a>から行えます。</div><p class="alert">原材料は1品目ずつ作成して選択してください</p><div class="material_line"><select name="additive[0]" ><option value="1" selected>原材料</option><option value="2">添加物</option></select><select name="materials[0]" class="material" id="material_list_0"><option value="0">-----------</option><option value="sample976">(こむぎこ)小麦粉</option><option value="sample977">★(さとう)砂糖</option><option value="sample985">(はくりきこ)薄力粉</option><option value="root">(みず)水</option></select><input type="text" class="amount" name="amount[0]" value="">g</div><div class="material_line"><select name="additive[1]" ><option value="1">原材料</option><option value="2">添加物</option></select><select name="materials[1]" class="material" id="material_list_1"><option value="0">-----------</option><option value="sample976">(こむぎこ)小麦粉</option><option value="sample977">★(さとう)砂糖</option><option value="sample985">(はくりきこ)薄力粉</option><option value="root">(みず)水</option></select><input type="text" class="amount" name="amount[1]" value="">g</div><a href="#modal_a" class="open_modal">原材料の新規入力</a><button name="cell_add[0]" value="1" class="add">入力欄追加</button><p class="aboutwater"><i class="fas fa-exclamation-circle"></i>水について</p><div class="detail_box" id="water_detail">水は、原材料表示には慣例的に表示しなくてもいいことになっていますが、原材料に使用されている場合は栄養成分計算に必要です。本ツールでは、あらかじめ登録してある水を選択しても、原材料表示には表示されず、栄養成分計算にのみ使用します。ただし、原材料表示にあえて表記したい場合、あるいは特殊な水を使用している場合は、新規に原材料登録をしてください。</div><p class="aboutwater"><i class="fas fa-exclamation-circle"></i>★のついている原材料について</p><div class="detail_box" id="water_detail">★のついている原材料には、廃棄率や重量変化率が設定されています。選択すると、これらを反映して栄養成分の計算を行いますので、条件が異なる場合は原材料情報を編集するか、<a href="#modal_a" class="open_modal noblock">新たに登録</a>してください。</div><p class="aboutwater"><i class="fas fa-exclamation-circle"></i>原材料の重量を入力する際の注意</p><div class="detail_box" id="water_detail">原材料や重量入力する際は、その原材料の乾物重量で入力する必要があります。例えば、おにぎりの場合の白米の量は、炊きあがった白米の量（出来上がりの原材料）ではなく、「炊く前の米の重量」となります。<br />食品成分データベースでも、「こめ―精白米　うるち米」の項目で「水稲穀粒」や「水稲めし」などと区分されています。いわゆる炊いたご飯の場合は、米粒ではなく「水稲めし」の栄養成分と炊き上げ前の乾物重量を選択、入力する必要があります。<br />乾物重量が不明な場合、<a href="https://www.mext.go.jp/component/a_menu/science/detail/__icsFiles/afieldfile/2015/12/24/1365334_1-0102.pdf" target="_blank">こちら</a>に重量変化率一覧が掲載されていますので、出来上がりの原材料の重量を該当する食品の重量変化率で割ったものが、乾物重量となります。上記の例の場合、炊きあがったご飯（水稲めし―精白米　うるち米）80gを使用する場合は、その重量変化率は210％ですので、原材料に入力すべき乾物重量は80÷2.1(210％)=約38gとなります。</div><p class="aboutwater"><i class="fas fa-exclamation-circle"></i>揚げ調理について</p><div class="detail_box" id="water_detail">揚げ調理を行う場合、原材料が油や衣を吸着することにより重量や栄養成分が変化します。これを吸油率と言い、下記の表の通り計算します。<br />揚げ調理する原材料の重量に対して、下記の割合で油や衣の材料を原材料表示に加えてください。<table><tr><td class="how">調理方法</td><td>油</td><td>小麦粉</td><td>パン粉</td><td>卵</td></tr><tr><td>素揚げ</td><td>10%</td><td></td><td></td><td></td></tr><tr><td>唐揚げ</td><td>10％</td><td>5％</td><td></td><td>5％</td></tr><tr><td>天ぷら普通衣</td><td>10％</td><td>5％</td><td></td><td></td></tr><tr><td>天ぷら厚い衣（かき揚げなど）</td><td>15％</td><td>8％</td><td></td><td>8％</td></tr><tr><td>フライ普通衣</td><td>10％</td><td>5％</td><td>5％</td><td>5％</td></tr><tr><td>フライ厚い衣（串カツなど）</td><td>20％</td><td>8％</td><td>8％</td><td>8％</td></tr><tr><td>炒め物・ソテー</td><td>7％</td><td></td><td></td><td></td></tr></table>計算例:鶏肉300gを唐揚げにする場合、鶏肉の重量300gに対して10％の油（30g）、5％の小麦粉（15g）、5％の卵（15g）を原材料に登録し、選択してください</div></div><div class="table_line"><div class="menu">アレルギー表示<a href="javascript:void(0)" class="js-modal-open" id="allergy"><i class="far fa-question-circle"></i></a></div><div class="input allergy"><div class="detail_box" id="allergy_detail">特定原材料に指定されているアレルギー物質です。原材料表示の最後に一括表示されます。以下の7つは必須項目ですので、原材料に含まれる場合は必ず選択してください。</div><label id="egg"><input type="checkbox" name="allergy[0]" value="1" id="egg">卵</label><label id="milk"><input type="checkbox" name="allergy[1]" value="1" id="milk">乳成分</label><label id="wheet"><input type="checkbox" name="allergy[2]" value="1" id="wheet">小麦</label><label id="shrinmp"><input type="checkbox" name="allergy[3]" value="1" id="shrinmp">えび</label><label id="crab"><input type="checkbox" name="allergy[4]" value="1" id="crab">かに</label><label id="peanuts"><input type="checkbox" name="allergy[5]" value="1" id="peanuts">落花生</label><label id="soba"><input type="checkbox" name="allergy[6]" value="1" id="soba">そば</label><div class="detail_box" id="allergy_detail">以下の21品目は、特定原材料に準ずるものとして表示が推奨されています。</div><label id="almond"><input type="checkbox" name="allergy[7]" value="1" id="almond">アーモンド</label><label id="abalone"><input type="checkbox" name="allergy[8]" value="1" id="abalone">あわび</label><label id="squid"><input type="checkbox" name="allergy[9]" value="1" id="squid">いか</label><label id="salmonroe"><input type="checkbox" name="allergy[10]" value="1" id="salmonroe">いくら</label><label id="organge"><input type="checkbox" name="allergy[11]" value="1" id="organge">オレンジ</label><label id="cashewnuts"><input type="checkbox" name="allergy[12]" value="1" id="cashewnuts">カシューナッツ</label><label id="kiwi"><input type="checkbox" name="allergy[13]" value="1" id="kiwi">キウイフルーツ</label><label id="beef"><input type="checkbox" name="allergy[14]" value="1" id="beef">牛肉</label><label id="walnut"><input type="checkbox" name="allergy[15]" value="1" id="walnut">くるみ</label><label id="sesame"><input type="checkbox" name="allergy[16]" value="1" id="sesame">ごま</label><label id="salmon"><input type="checkbox" name="allergy[17]" value="1" id="salmon">さけ</label><label id="mackerel"><input type="checkbox" name="allergy[18]" value="1" id="mackerel">さば</label><label id="beens"><input type="checkbox" name="allergy[19]" value="1" id="beens">大豆</label><label id="chicken"><input type="checkbox" name="allergy[20]" value="1" id="chicken">鶏肉</label><label id="banana"><input type="checkbox" name="allergy[21]" value="1" id="banana">バナナ</label><label id="pork"><input type="checkbox" name="allergy[22]" value="1" id="pork">豚肉</label><label id="mushroom"><input type="checkbox" name="allergy[23]" value="1" id="mushroom">まつたけ</label><label id="peach"><input type="checkbox" name="allergy[24]" value="1" id="peach">もも</label><label id="yam"><input type="checkbox" name="allergy[25]" value="1" id="yam">やまいも</label><label id="apple"><input type="checkbox" name="allergy[26]" value="1" id="apple">りんご</label><label id="
    gelatin"><input type="checkbox" name="allergy[27]" value="1" id="
    gelatin">ゼラチン</label></div><div class="table_line"><div class="menu">この分量での製造ロット数<div class="needed">必須</div></div><div class="input"><div class="detail_box" id="rot_detail">デモ画面ではこの機能は使用できません。</div><input type="text" name="rot" class="wide" value="" disabled>個</div></div><div class="table_line"><div class="menu">識別表示<a href="javascript:void(0)" class="js-modal-open" id="recycle"><i class="far fa-question-circle"></i></a></div><div class="input recycle"><input type="checkbox" name="recycle[1]" value="1" id="re1"><img src="./img/recycle/001.gif"><label for="re1">プラ容器</label><input type="checkbox" name="recycle[2]" value="2" id="re2"><img src="./img/recycle/002.gif"><label for="re2">紙容器</label><input type="checkbox" name="recycle[3]" value="3" id="re3"><img src="./img/recycle/003.gif"><label for="re3">ペットボトル</label><input type="checkbox" name="recycle[4]" value="4" id="re4"><img src="./img/recycle/004.gif"><label for="re4">アルミ</label><input type="checkbox" name="recycle[5]" value="5" id="re5"><img src="./img/recycle/005.gif"><label for="re5">スチール</label></div></div><div class="table_line"><div class="menu">賞味／消費期限<div class="needed">必須</div><a href="javascript:void(0)" class="js-modal-open" id="limit"><i class="far fa-question-circle"></i></a></div><div class="input limit"><div class="detail_box" id="limit_detail">消費期限又は賞味期限を選択してください。具体的な期限は空白でも構いません。<br />消費期限とは、適切に保存した場合に安全に食べることができる期限で、日数の短いもの(弁当、サンドイッチ、総菜、パン、生菓子など）が該当します。賞味期限とは、適切に保存した場合に品質が保持される期限のことで、比較的期限の長いものが該当します。賞味期限が3カ月以上の場合は、年・月で記載することも可能です。<br />日付は空欄のままで、あとで手書きすることもできます。ハンドラベラーなどで張り付ける場合、貼り付け個所がどこであるか(枠外右下、底面など）を記載しておくと便利です。</div><select name="limit" class="limit"><option value="1" selected>消費期限</option><option value="2">賞味期限</option></select><input type="text" class="limit_box" name="limit_content" value=""><p class="alert">20文字以内</p><p class="alert">空欄可</p></div></div><div class="table_line"><div class="menu">保存方法<a href="javascript:void(0)" class="js-modal-open" id="keep"><i class="far fa-question-circle"></i></a></div><div class="input"><div class="detail_box" id="stock_detail">デモ画面では内容を編集できません。</div><select name="stock" class="wide"><option value="0">高温多湿を避け常温（25度以下）で保存</option></select></div></div><div class="table_line"><div class="menu">内容量<a href="javascript:void(0)" class="js-modal-open" id="contain"><i class="far fa-question-circle"></i></a></div><div class="input"><input type="text" class="wide" name="contain" value=""><p class="alert">単位を含め10文字以内</p><p class="alert">包装や容器が透明で内容量が一見して明らかな場合は、この表記は省略できます</p></div></div><div class="table_line"><div class="menu">製造者<a href="javascript:void(0)" class="js-modal-open" id="product"><i class="far fa-question-circle"></i></a></div><div class="input"><p></p><p></p><p class="alert">デモ画面のため、サンプルが入ります</div></div><div class="table_line"><div class="menu">栄養成分表示(100gあたり)<a href="javascript:void(0)" class="js-modal-open" id="nutrition"><i class="far fa-question-circle"></i></a></div><div class="input nutrition"><div class="detail_box" id="nutrition_detail">2020年4月1日より、下記の5項目については、一部の例外を除いて必須となっています。<br />アドバンストモードでは、原材料からの自動計算機能が備わっていますが、実測値を手入力することもできます。<br />栄養成分表示が省略できるのは次のケースです。<ur><li>小規模事業者（消費税法における納税義務免除事業者）が自身で販売する場合 ただし、該当する事業者でも、スーパーや直売所等で販売する場合は必須となります。</li><li>日替わり弁当など内容が一定しないもの</li><li>商品の表示可能面積が、30c㎡以下の場合</li></ul></div><div><input type="radio" name="nutrition" value="3" id="none" class="nutrition_select"><label for="none">この項目は利用しない</label></div><div><input type="radio" name="nutrition" value="1" id="estimate" class="nutrition_select" checked><label for="estimate">栄養成分は自動計算(栄養成分表示の最後に「推計値」の文言が入ります)</label></div><div><input type="radio" name="nutrition" value="2" id="real" class="nutrition_select"><label for="real">栄養成分の実測値を入力する</label></div><div class="nutrition_form"><p><div class="title">熱量</div>:<input type="text" name="energy" value=""  class="nutrition_form" disabled>kcal</p><p><div class="title">たんぱく質</div>:<input type="text" name="protein" value="" class="nutrition_form" disabled>g</p><p><div class="title">脂質</div>:<input type="text" name="fat" value="" class="nutrition_form" disabled>g</p><p><div class="title">炭水化物</div>:<input type="text" name="carbon" value="" class="nutrition_form" disabled>g</p><p><div class="title">食塩</div>:<input type="text" name="salt" value="" class="nutrition_form" disabled>g</p></div><p class="alert">デモ画面では、自動計算結果の一部が＊に置き換わって表示されます</p></div></div><div class="table_line"><div class="menu">枠外自由入力欄<a href="javascript:void(0)" class="js-modal-open" id="free"><i class="far fa-question-circle"></i></a></div><div class="input"><div class="detail_box" id="free_detail">枠外の自由入力スペースです。ただし、制限文字数内でも印刷枠に収まりきらない場合があります。</div><textarea name="free"></textarea><p class="alert">25文字以内</p></div></div></div></div></div></div><div class="table"><div class="table_line"><div class="menu">印刷開始位置調整</div><div class="input"><div class="detail_box" id="limit_detail">ご利用の環境により、印刷開始位置にずれが生じます。印刷結果にずれが生じる場合は、印刷位置を調整してください。プリンターの設定によってはレイアウトが正しく表示されない場合があります。「フチあり」「フチなし」や「余白」、「倍率」項目で「用紙に合わせる」「印刷表示領域にあわせる」などの設定を変えてみてください。開発環境では、主にCanonまたはEPSON製のプリンターを使用し、プリンターの設定はデフォルト、GoogleChromeの「印刷」メニューからデフォルト設定でテストしています。</div><p>上下方向<input type="text" class="adjust" name="adjust" value="" id="adjust"></p><p class="alert">上へずらす場合は-をつけて、下へずらす場合は数字だけを入力してください</p><p>左右方向<input type="text" class="adjust" name="lradjust" value="" id="adjust"></p><p class="alert">左へずらす場合は-をつけて、右へずらす場合は数字だけを入力してください</p><p class="alert">単位はミリ</p></div></div></div><div class="table"><div class="table_line"><div class="menu">用紙選択</div><div class="input"><div class="detail_box" id="size_detail">ご利用になる用紙を選択してください。用紙は市販のラベル用紙をお買い求めください。なお、10面、18面、24面は有料プランのみの設定となります。</div><div class="size_box"><select name="size"><option value="10">10面</option><option value="12">12面</option><option value="18">18面</option><option value="180">18面（フォント小）</option><option value="24">24面（フォント小）</option></select><p class="alert">フォント小はフォントサイズが6ポイントとなります。通常食品表示ラベルは8ポイント以上のフォントサイズで作成する必要がありますが、商品の表示可能面積が150平方センチ以下の場合、特例として5.5ポイントまで縮小することが認められています。フォント小を選択の際は対象商品かどうかにご注意ください。</p></div></div></div></div><div class="remodal" data-remodal-id="modal_a"><button data-remodal-action="close" class="remodal-close"></button><h2>原材料マスターの新規登録</h2><p class="alert">こちらで登録した原材料マスターは、だれでも閲覧できる状態となりますので、あくまでサンプルとして入力してください。また、定期的に削除いたしますので、予めご了承ください</p><p class="aboutwater"><i class="fas fa-exclamation-circle"></i>水について</p><div class="detail_box" id="water_detail">水は、原材料表示には慣例的に表示しなくてもいいことになっていますが、原材料に使用されている場合は栄養成分計算に必要です。本ツールでは、水はあらかじめ原材料マスターに登録していますので、改めて登録する必要はありません。ただし、原材料表示に表記したい場合、あるいは特殊な水を使用している場合は、新規に登録してください。</div><div class="table"><div class="caption">原材料基本情報</div><div class="table_line"><div class="menu">原材料名<div class="needed">必須</div></div><div class="input"><div class="detail_box" id="name_detail">原材料の名称です。入力者が後でわかりやすい名称を入力してください。多くの場合、ここは原材料の商品名が入ります。</div><input type="text" class="wide" name="m_name" value="" id="m_name"><p class="alert">20文字以内</p></div></div><div class="table_line"><div class="menu">原材料名かな<div class="needed">必須</div></div><div class="input"><div class="detail_box" id="name_kana_detail">原材料名の仮名を平仮名で入力してください。商品データ作成の際、平仮名順に原材料がソートされます。</div><input type="text" class="wide" name="m_name_kana" value="" id="m_name_kana"><p class="alert">30文字以内</p><p class="alert">登録原材料を平仮名順にソートする際に使用します</p></div></div><div class="table_line"><div class="menu">原材料表示での表示名<div class="needed">必須</div></div><div class="input"><div class="detail_box" id="display_detail">食品表示ラベルに表示される原材料名を入力してください。ここでは、「最も一般的な名称」を用いて入力する必要があります。原材料に用いた商品の商品名は、原材料ではありません。また、「国産」などの文言を入れることもできません。<br />例）×国産小麦粉→小麦粉（国産は不可）　×四つ葉バター→バター（特定の商品、メーカー名は不可）</div><input type="text" class="wide" name="m_display" value="" id="m_display"><p class="alert">20文字以内</p></div></div><div class="table_line"><div class="menu">原産地<div class="needed">必須</div></div><div class="input"><div class="detail_box" id="madein_detail">原材料に占める重量割合が最も大きいものの産地が、原材料表示に表示されます。該当の材料が国産の場合は「国産」、「都道府県名」、「一般的に知られた地名」を、輸入品の場合は原産国を入力しますが、輸入品であっても加工食品で最終加工地が国内の場合は「国内製造」と記述できます。</div><input type="text" class="wide" name="m_madein" value="" id="m_madein"><p class="alert">10文字以内</p></div></div><div class="table_line"><div class="menu">梱包量(kg)</div><div class="input"><div class="detail_box" id="rot_detail">原材料の仕入れ単位です。原価計算に使用します。デモ画面ではこの機能は使用できません。</div><input type="text" class="wide" name="m_rot" value="" id="m_rot" placeholder="デモ画面では使用できません" disabled></div></div><div class="table_line"><div class="menu">価格(円)</div><div class="input"><div class="detail_box" id="price_detail">原材料の仕入れ価格です。原価計算に使用します。デモ画面ではこの機能は使用できません。</div><input type="text" class="wide" name="m_price" value="" id="m_price" placeholder="デモ画面では使用できません" disabled></div></div></div><div class="table"><div class="table_line"><div class="caption">栄養成分表示(100gあたり)<div class="detail_box" id="nutrition_detail">100gあたりの栄養成分を入力します。全ての原材料に正しく入力されていれば、商品データを登録した際にここで入力した情報から自動的に栄養成分を計算します。個々の原材料の栄養成分については、実際に計測する他、メーカーに問い合わせるか、文部科学省の<a href="https://fooddb.mext.go.jp/" target="_blank">食品成分データベース</a>などをご利用ください。</div></div><div class="accordion_one0"><div class="accordion_header0">文部科学省の食品成分データベースから引用する</div><div class="accordion_inner0"><div class="detail_box">食品成分データベースは、改編されることがあります。本表は<a href="https://www.mext.go.jp/a_menu/syokuhinseibun/mext_01110.html" target="_blank">「日本食品標準成分表2020年版（八訂）」</a>をデータソースとして利用していますが、ご利用の際は<a href="https://www.mext.go.jp/a_menu/syokuhinseibun/index.htm" target="_blank">文部科学省のWebサイト</a>から改訂や訂正がないかご確認いただきますようお願いします</div><div class="box_one0"><div class="accordion_one"><div class="accordion_header">穀類(205件)</div><div class="accordion_inner"><div class="box_one"><div class="line"><a href="javascript:void(0)" id="1" class="m_material_select"><div class="select_box"><div class="select">選択</div></div></a><a href="javascript:void(0)" id="1" class="m_material_select text">アマランサス　玄穀</a></div><div class="line line_color"><a href="javascript:void(0)" id="2" class="m_material_select"><div class="select_box"><div class="select">選択</div></div></a><a href="