に当たって反映させることが望ましいとされる項目ですので、不明な場合は空欄または0でも構いません。</div><input type="text" class="wide" name="destruction" value="" id="m_destruction">%</div></div><div class="table_line"><div class="menu">重量変化率</div><div class="input"><div class="detail_box" id="price_detail">食品の調理に際しては、水さらしや加熱により食品中の成分が溶出や変化し、一方、調理に用いる水や油の吸着により食品の重量が増減します。この重量の変化率を重量変化率（%）と言います。<br />この数値は栄養成分表示の計算に当たって反映させることが望ましいとされる項目ですので、不明な場合は空欄または0でも構いません。</div><input type="text" class="wide" name="weight" value="" id="m_weight">%</div></div></div><div class="go_button"><button name="m_comp" class="comp" id="m_material_comp" data-remodal-action="confirm"></button></div><input type="hidden" id="material_times" value="1"></div><div class="remodal" data-remodal-id="modal_b"><button data-remodal-action="close" class="remodal-close"></button><h2>原材料マスターの編集</h2><div class="detail_box">デモ画面では、削除以外できません。</div><table class="list"><tr><td class="main_frame">小麦粉</td><td class="button"><a href="sample.php?advanced&del=sample976"><i class="fa-solid fa-trash"></i></a></td></tr><tr><td class="main_frame">砂糖</td><td class="button"><a href="sample.php?advanced&del=sample977"><i class="fa-solid fa-trash"></i></a></td></tr><tr><td class="main_frame">薄力粉</td><td class="button"><a href="sample.php?advanced&del=sample985"><i class="fa-solid fa-trash"></i></a></td></tr></table></div><div class="go_button"><button class="print wide" name="print" onClick=gtag('event','click'{['event_category':'demo']});></button></div><p class="alert">ラベルはPDFファイルで作成されるため、PDFファイルを読み込めるアプリやソフトが必要です。印刷ボタンを押しても何も表示されない場合は、下記の例を参考にPDFファイル閲覧アプリ・ソフトをインストールし、アプリ・ソフトから開いてみてください。</p><p><a href="https://apps.apple.com/jp/app/adobe-acrobat-reader-pdf%E6%9B%B8%E9%A1%9E%E3%81%AE%E7%AE%A1%E7%90%86/id469337564" target="_blank">iOSの場合</a></p><p><a href="https://play.google.com/store/apps/details?id=com.adobe.reader&hl=ja&gl=US" target="_blank">androidの場合</a></p><p><a href="https://www.adobe.com/jp/acrobat/pdf-reader.html?mv=search&sdid=5JRH8JQH&ef_id=EAIaIQobChMI8cra